import React, { useState, useEffect } from 'react';
// import axios from 'axios'; // Uncomment if you use axios

interface Student {
  sbd: string;
  name: string;
  toan: number;
  vat_li: number;
  hoa_hoc: number;
  total_A_score: number;
}

const mockStudents: Student[] = [
  { sbd: '001', name: 'Nguyễn Văn A', toan: 9.0, vat_li: 8.5, hoa_hoc: 9.0, total_A_score: 26.5 },
  { sbd: '002', name: 'Trần Thị B', toan: 8.5, vat_li: 9.0, hoa_hoc: 8.5, total_A_score: 26.0 },
];



const TopStudents: React.FC = () => {
  const [students, setStudents] = useState<Student[]>([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const fetchTopStudents = async () => {
      try {
        // const response = await axios.get('/api/students/top-a-group'); // Replace with your actual API endpoint
        // setStudents(response.data);
        // Sort mock data to ensure top 10 by total_A_score
        const sortedStudents = [...mockStudents].sort((a, b) => b.total_A_score - a.total_A_score);
        setStudents(sortedStudents.slice(0, 10));
      } catch (err) {
        setError('Error fetching top students data.');
      } finally {
        setLoading(false);
      }
    };
    fetchTopStudents();
  }, []);

  if (loading) return <div style={{padding: '30px'}}>Đang tải danh sách học sinh top...</div>;
  if (error) return <div style={{padding: '30px', color: 'red'}}>Lỗi: {error}</div>;

  return (
    <div style={{ padding: '30px' }}>
      <h2 style={{ fontSize: '1.8rem', marginBottom: '20px', color: '#333' }}>Top 10 Học sinh Khối A (Toán, Lý, Hóa)</h2>
      <div style={{ background: 'white', padding: '20px', borderRadius: '8px', boxShadow: '0 2px 8px rgba(0,0,0,0.04)' }}>
        {students.length > 0 ? (
          <table style={{ width: '100%', borderCollapse: 'collapse' }}>
            <thead>
              <tr style={{ background: '#f2f2f2' }}>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>SBD</th>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>Họ và tên</th>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>Toán</th>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>Vật lý</th>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>Hóa học</th>
                <th style={{ padding: '12px', border: '1px solid #ddd', textAlign: 'left' }}>Tổng điểm khối A</th>
              </tr>
            </thead>
            <tbody>
              {students.map((student) => (
                <tr key={student.sbd}>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.sbd}</td>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.name}</td>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.toan.toFixed(2)}</td>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.vat_li.toFixed(2)}</td>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.hoa_hoc.toFixed(2)}</td>
                  <td style={{ padding: '12px', border: '1px solid #ddd' }}>{student.total_A_score.toFixed(2)}</td>
                </tr>
              ))}
            </tbody>
          </table>
        ) : (
          <p>Không tìm thấy học sinh nào trong top 10 khối A.</p>
        )}
      </div>
    </div>
  );
};

export default TopStudents;
